  return (

      <div data-testid='home-page'>
        <Logo />
        <h1>Seu <span className='gradient'>duo</span> está aqui.</h1>
        <GridGames />
        <Dialog.Root>
          <BoxAnnouncement />
          <Dialog.Portal>
            <Dialog.Overlay style={{background:'red'}}/>

            <Dialog.Content>
              <Dialog.Title>Publique um anúncio</Dialog.Title>

              <Dialog.Content>
                <p>teste</p>
              </Dialog.Content>
            </Dialog.Content>
          </Dialog.Portal>
        </Dialog.Root>
      </div>

  );
}
